import Axios from './caller.services'


let getAllstuff= ()=>{
	return Axios.get('/api/stuff')
}

let getStuff=()=>{
	return Axios.get('/api/stuff/635937975394550dff7ad1f7')
}

let modifyThing=(Thing)=>{
	return Axios.post('/api/stuff',Thing)
}
export const stuffService = {
	getAllstuff,
	getStuff,
	modifyThing
}
